INSERT INTO `js_sys_config` VALUES ('1643079924482158592', '用户管理-初始密码修改策略', 'sys.user.initPasswordModify', '1', '0', 'system', '2023-04-04 10:35:56', 'system', '2023-04-04 10:35:56', '0：初始密码修改策略关闭，没有任何提示；1：提醒用户，如果未修改初始密码，则在登录时提醒修改密码对话框；2：强制实行初始密码修改，登录后若不修改密码则不能进行系统操作');
INSERT INTO `js_sys_config` VALUES ('1643079924607987712', '用户管理-账号密码修改策略', 'sys.user.passwordModify', '1', '0', 'system', '2023-04-04 10:35:56', 'system', '2023-04-04 10:35:56', '0：密码修改策略关闭，没有任何提示；1：提醒用户，如果长时间未修改密码，则在登录时提醒修改密码对话框；2：强制实行密码修改，登录后若不修改密码则不能进行系统操作。');
INSERT INTO `js_sys_config` VALUES ('1643079924746399744', '用户管理-账号密码修改策略验证周期', 'sys.user.passwordModifyCycle', '30', '0', 'system', '2023-04-04 10:35:56', 'system', '2023-04-04 10:35:56', '密码安全修改周期是指定时间内提醒或必须修改密码（例如设置30天）的验证时间（天），超过这个时间登录系统时需，提醒用户修改密码或强制修改密码才能继续使用系统。单位：天，如果设置30天，则第31天开始强制修改密码');
INSERT INTO `js_sys_config` VALUES ('1643079925073555456', '用户管理-密码修改多少次内不允许重复', 'sys.user.passwordModifyNotRepeatNum', '1', '0', 'system', '2023-04-04 10:35:56', 'system', '2023-04-04 10:35:56', '默认1次，表示不能与上次密码重复；若设置为3，表示并与前3次密码重复');
INSERT INTO `js_sys_config` VALUES ('1643079925199384576', '用户管理-账号密码修改最低安全等级', 'sys.user.passwordModifySecurityLevel', '0', '0', 'system', '2023-04-04 10:35:56', 'system', '2023-04-04 10:35:56', '0：不限制等级（用户在修改密码的时候不进行等级验证）；1：限制最低等级为很弱；2：限制最低等级为弱；3：限制最低等级为安全；4：限制最低等级为很安全');
