-- ----------------------------
DROP TABLE IF EXISTS `js_cms_visit_log`;
CREATE TABLE `js_cms_visit_log`  (
  `id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '编号',
  `request_url` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '请求的URL地址',
  `request_url_host` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '受访域名',
  `source_referer` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '来源页面/上一个页面',
  `source_referer_host` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '来源域名',
  `source_type` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '访问来源类型（1直接访问 2搜索引擎 3外部链接 4内部访问）',
  `search_engine` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '使用的搜索引擎',
  `search_word` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '搜索的关键词',
  `remote_addr` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '客户IP地址',
  `user_agent` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '用户代理字符串',
  `user_language` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '客户机语言',
  `user_screen_size` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '客户机屏幕大小0x0',
  `user_device` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '客户机设备类型（电脑、平板、手机、未知）',
  `user_os_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '客户机操作系统',
  `user_browser` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '客户机浏览器',
  `user_browser_version` varchar(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '浏览器版本',
  `unique_visit_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '唯一访问标识',
  `visit_date` char(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '本次访问日期（年月日）',
  `visit_time` datetime NULL DEFAULT NULL COMMENT '本次访问时间',
  `is_new_visit` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '是否新访问（30分内）',
  `first_visit_time` decimal(20, 0) NULL DEFAULT NULL COMMENT '首次访问时间戳（30分钟内）',
  `prev_remain_time` decimal(20, 0) NULL DEFAULT NULL COMMENT '上页面停留时间（秒）',
  `total_remain_time` decimal(20, 0) NULL DEFAULT NULL COMMENT '本次访问总停留时间（秒）',
  `site_code` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '站点编码',
  `site_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '站点名称',
  `category_code` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '栏目编码',
  `category_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '栏目名称',
  `content_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '栏目内容编号',
  `content_title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '访问页面标题',
  `visit_user_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '访问用户编码',
  `visit_user_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '访问用户姓名',
  `corp_code` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '0' COMMENT '租户代码',
  `corp_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT 'JeeSite' COMMENT '租户名称',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `cms_visit_log_cc`(`category_code` ASC) USING BTREE,
  INDEX `cms_visit_log_ci`(`content_id` ASC) USING BTREE,
  INDEX `cms_visit_log_fvt`(`first_visit_time` ASC) USING BTREE,
  INDEX `cms_visit_log_inv`(`is_new_visit` ASC) USING BTREE,
  INDEX `cms_visit_log_ra`(`remote_addr` ASC) USING BTREE,
  INDEX `cms_visit_log_sc`(`site_code` ASC) USING BTREE,
  INDEX `cms_visit_log_uvid`(`unique_visit_id` ASC) USING BTREE,
  INDEX `cms_visit_log_vd`(`visit_date` ASC) USING BTREE,
  INDEX `cms_visit_log_vt`(`visit_time` ASC) USING BTREE,
  INDEX `idx_cms_visit_log_corpc`(`corp_code` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '访问日志表' ROW_FORMAT = DYNAMIC;

