  `start_delay` decimal(19, 0) NULL DEFAULT NULL COMMENT '触发器延迟启动时间',
  `repeat_interval` decimal(19, 0) NULL DEFAULT NULL COMMENT '循环间隔时间（毫秒）',
  `repeat_count` decimal(10, 0) NULL DEFAULT NULL COMMENT '循环次数（ -1 无期限）',
